  return (
    <>
      <Heading title="Search" backButton btnProfile />
      {"hasUsers" && <UsersList />}
      {"hasPosts" ? (
        <PostsList />
      ) : (
        <div className="message">No posts found</div>
      )}
    </>
  );
}
